        <h3> Quick Moves</h3>
        <table>
          <thead>
            <tr>
              <th key={1}>Stats</th>

              {props.quickMoveData.map(element => {
                return (
                  <th key={element.fastMoveName}>{element.fastMoveName}</th>
                );
              })}
            </tr>
          </thead>

          <tbody>
